import React ,{ Component } from 'react'
import { Icon, Input } from 'semantic-ui-react'

class Search extends Component{

    render(){

        return(
            <Input
                icon={<Icon name='search' inverted circular link />} 
                placeholder='Search...' 
            />
        )
    }
}

export default Search
